import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <>
      <Navbar />
      <Switch>
        <Route exact path="/" component={Home} />
        <Route path="/blogs" component={Blogs} />
        <Route path="/projects" component={Projects} />
        <Route path="/about" component={About} />
        <Route path="/contact" component={Contact} />
      </Switch>
    </>
    </div>
  );
}

export default App;
